import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { SurveyResultsResponse } from '../types';
import { surveyApi } from '../services/api';

const SurveyResults: React.FC = () => {
  const { id } = useParams<{ id: string }>();
  const navigate = useNavigate();
  const [results, setResults] = useState<SurveyResultsResponse | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    if (id) {
      loadResults(parseInt(id));
    }
  }, [id]);

  const loadResults = async (surveyId: number) => {
    try {
      setLoading(true);
      const resultsData = await surveyApi.getSurveyResults(surveyId);
      setResults(resultsData);
      setError(null);
    } catch (err) {
      setError('Errore nel caricamento dei risultati');
      console.error('Errore:', err);
    } finally {
      setLoading(false);
    }
  };

  const getPercentage = (voteCount: number, total: number): number => {
    if (total === 0) return 0;
    return Math.round((voteCount / total) * 100);
  };

  if (loading) {
    return <div className="loading">Caricamento risultati...</div>;
  }

  if (error || !results) {
    return (
      <div className="error">
        {error || 'Risultati non trovati'}
        <button onClick={() => navigate('/')} className="btn btn-primary" style={{ marginLeft: '1rem' }}>
          Torna alla Lista
        </button>
      </div>
    );
  }

  return (
    <div>
      <div style={{ marginBottom: '2rem', display: 'flex', gap: '1rem' }}>
        <button onClick={() => navigate('/')} className="btn btn-secondary">
          ‚Üê Torna alla Lista
        </button>
        <button onClick={() => navigate(`/survey/${results.survey_id}`)} className="btn btn-primary">
          Partecipa al Sondaggio
        </button>
      </div>

      <div className="card">
        <h1 className="card-title">Risultati: {results.survey_title}</h1>

        <div style={{ marginBottom: '2rem' }}>
          <h3>Totale voti: {results.total_votes}</h3>
        </div>

        {results.total_votes === 0 ? (
          <div className="text-center" style={{ padding: '2rem' }}>
            <h3>Nessun voto ancora registrato</h3>
            <p>Sii il primo a votare!</p>
            <button 
              onClick={() => navigate(`/survey/${results.survey_id}`)}
              className="btn btn-primary"
            >
              Vota Ora
            </button>
          </div>
        ) : (
          <div>
            <h3 style={{ marginBottom: '1.5rem' }}>Risultati per opzione:</h3>

            {results.results.map((result) => {
              const percentage = getPercentage(result.vote_count, results.total_votes);

              return (
                <div key={result.option_id} className="result-item">
                  <div className="result-option">
                    <span><strong>{result.option_text}</strong></span>
                    <span>{result.vote_count} voti ({percentage}%)</span>
                  </div>

                  <div className="result-bar">
                    <div 
                      className="result-bar-fill" 
                      style={{ width: `${percentage}%` }}
                    />
                    <div className="result-percentage">
                      {percentage}%
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        )}

        <div style={{ marginTop: '2rem', textAlign: 'center' }}>
          <button 
            onClick={() => loadResults(results.survey_id)}
            className="btn btn-secondary"
          >
            üîÑ Aggiorna Risultati
          </button>
        </div>
      </div>
    </div>
  );
};

export default SurveyResults;
